import React from "react";
import '../styles/snippets/Createboxpopup.css'
import { useEffect, useState } from "react";

function Createboxpopup(props) {

    const [click, setClick] = useState(false)

    useEffect(() => {
        if (click) {
            props.stateChanger(false)
        }
    }, [click, props])

    return (
        <div onClick={() => setClick(!click)} className="createbox-container-overlay">
            <div className="createbox-popup-modal">
                <div>Create Box</div>
                <div className='brand-landingpage-two-fields'>
                            <div className='brand-landingpage-field'>
                                <label htmlFor='brand-register-firstname'>BRAND NAME:</label>
                                {editview ? <input required onChange={(e) => { setBrandname(e.target.value) }} type="text" value={brandname}></input> : <div className="brandprofile-field-value"> {brandname} </div>}
                            </div>
                        </div>
                        <div className='brand-landingpage-two-fields'>
                            <div className='brand-landingpage-field'>
                                <label htmlFor='brand-register-firstname'>EMAIL:</label>
                                <div className="brandprofile-field-value"> {email} </div>
                            </div>
                        </div>
            </div>
        </div>
    )
}

export default Createboxpopup
